    [],nt"revision_timestamp": "2015-09-26T20:56:28.343633",nt"name": "geosat-44-high-accuracy-high-resolution-gravity",nt"isopen":
    false,nt"url": null,nt"notes": "This satellite altimeter data base contains
    precise geoid and gravity anomaly profiles which were constructed from the average
    of 44 repeat cycles of Geosat. The data are contained in two files: (1) geo44asc.bin
    (987755 records) contains the ascending profiles which run southeast to northwest
    between 72S and 72N, and (2) geo44des.bin (991313 records) contains all of the descending
    profiles. The data parameters in addition to time and location are geoid height,
    gravity anomaly and uncertainty in gravity anomaly. For additional information see
    geosat.txt in this directory.",nt"license_title": null,nt"extras": [{ntt"key":
